<h2><span class="mw-headline" id="Description">Description</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=The_Moon&amp;action=edit&amp;section=1" title="Edit section: Description">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>In past times, Earth's moon was little more than a glimmer of the dreams held within those who gazed upon it. The cratered surface now glittering with countless refineries and bases, few will ever remember it as being anything more than a stepping stone to the stars.
</p>
